      Hint: Content
      Value: |
        <p style="margin-bottom: 0.0001pt;">Most major retailers carry our products. You can click the <strong>Where to Buy</strong> button that appears below each product to view both online and local retailers that carry Cadet products near you. Additional where-to-buy information by state:</p>
        <ul style="list-style-type: disc;">
            <li>If you live in <strong>AZ</strong>, <strong>CA</strong>, <strong>CO</strong>, or <strong>NV</strong>, please call our distributor, Animal Supply, at 1-800-323-2963 to find out which stores in your area carry Cadet duck treats, bully sticks, and retrievers. </li>
            <li>If you live in <strong>WI</strong>, <strong>IA</strong>, or <strong>IL</strong>, please check your local Blain&rsquo;s Fleet &amp; Farm stores for smaller sizes in Cadet duck treats, bully sticks, and retrievers.</li>
            <li>If you live in <strong>IA</strong>, <strong>MN</strong>, <strong>ND</strong>, or <strong>WI</strong>, check your local Mills Fleet Farm stores for smaller sizes in Cadet duck treats, bully sticks, and retrievers.</li>
        </ul>
